(7, 'test estres', 'Estrés', '¿Qué es Lorem Ipsum?\r\nLorem Ipsum es simplemente el texto de relleno de las imprentas y archivos de texto. Lorem Ipsum ha sido el texto de relleno estándar de las industrias desde el año 1500, cuando un impresor (N. del T. persona que se dedica a la imprenta) desconocido usó una galería de textos y los mezcló de tal manera que logró hacer un libro de textos especimen. No sólo sobrevivió 500 años, sino que tambien ingresó como texto de relleno en documentos electrónicos, quedando esencialmente igual al original. Fue popularizado en los 60s con la creación de las hojas \"Letraset\", las cuales contenian pasajes de Lorem Ipsum, y más recientemente con software de autoedición, como por ejemplo Aldus PageMaker, el cual incluye versiones de Lorem Ipsum.\r\n\r\n¿Por qué lo usamos?\r\nEs un hecho establecido hace demasiado tiempo que un lector se distraerá con el contenido del texto de un sitio mientras que mira su diseño. El punto de usar Lorem Ipsum es que tiene una distribución más o menos normal de las letras, al contrario de usar textos como por ejemplo \"Contenido aquí, contenido aquí\". Estos textos hacen parecerlo un español que se puede leer. Muchos paquetes de autoedición y editores de páginas web usan el Lorem Ipsum como su texto por defecto, y al hacer una búsqueda de \"Lorem Ipsum\" va a dar por resultado muchos sitios web que usan este texto si se encuentran en estado de desarrollo. Muchas versiones han evolucionado a través de los años, algunas veces por accidente, otras veces a propósito (por ejemplo insertándole humor y cosas por el estilo).\r\n\r\n\r\n¿De dónde viene?\r\nAl contrario del pensamiento popular, el texto de Lorem Ipsum no es simplemente texto aleatorio. Tiene sus raices en una pieza cl´sica de la literatura del Latin, que data del año 45 antes de Cristo, haciendo que este adquiera mas de 2000 años de antiguedad. Richard McClintock, un profesor de Latin de la Universidad de Hampden-Sydney en Virginia, encontró una de las palabras más oscuras de la lengua del latín, \"consecteur\", en un pasaje de Lorem Ipsum, y al seguir leyendo distintos textos del latín, descubrió la fuente indudable. Lorem Ipsum viene de las secciones 1.10.32 y 1.10.33 de \"de Finnibus Bonorum et Malorum\" (Los Extremos del Bien y El Mal) por Cicero, escrito en el año 45 antes de Cristo. Este libro es un tratado de teoría de éticas, muy popular durante el Renacimiento. La primera linea del Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", viene de una linea en la sección 1.10.32\r\n\r\nEl trozo de texto estándar de Lorem Ipsum usado desde el año 1500 es reproducido debajo para aquellos interesados. Las secciones 1.10.32 y 1.10.33 de \"de Finibus Bonorum et Malorum\" por Cicero son también reproducidas en su forma original exacta, acompañadas por versiones en Inglés de la traducción realizada en 1914 por H. Rackham.\r\n\r\n¿Dónde puedo conseguirlo?\r\nHay muchas variaciones de los pasajes de Lorem Ipsum disponibles, pero la mayoría sufrió alteraciones en alguna manera, ya sea porque se le agregó humor, o palabras aleatorias que no parecen ni un poco creíbles. Si vas a utilizar un pasaje de Lorem Ipsum, necesitás estar seguro de que no hay nada avergonzante escondido en el medio del texto. Todos los generadores de Lorem Ipsum que se encuentran en Internet tienden a repetir trozos predefinidos cuando sea necesario, haciendo a este el único generador verdadero (válido) en la Internet. Usa un diccionario de mas de 200 palabras provenientes del latín, combinadas con estructuras muy útiles de sentencias, para generar texto de Lorem Ipsum que parezca razonable. Este Lorem Ipsum generado siempre estará libre de repeticiones, humor agregado o palabras no características del lenguaje, etc.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTSsISIrjaPTRp_2B23S3-LviGQUhxqubtkIg&s', 13, '2024-07-13 09:36:19'),
(11, 'Estrategias Efectivas para Mejorar la Autoestima', 'Autoestima', '<p>La autoestima es un aspecto crucial de nuestro bienestar mental y emocional. Tener una buena autoestima significa reconocer y valorar nuestras capacidades y logros, mientras que una baja autoestima puede afectar negativamente nuestras relaciones, rendimiento y calidad de vida. A continuación, te presentamos algunas estrategias efectivas para mejorar y fortalecer tu autoestima.</p><h4>1. <strong>Practica la Autoaceptación</strong></h4><p>Acepta tus imperfecciones y comprende que todos cometemos errores. La autoaceptación es el primer paso hacia una autoestima saludable. Haz una lista de tus fortalezas y áreas de mejora y trabaja en ellas sin juzgarte.</p><h4>2. <strong>Establece Metas Realistas</strong></h4><p>Fija objetivos alcanzables y celebra tus logros, por pequeños que sean. Establecer metas realistas te permite experimentar el éxito, lo cual refuerza tu confianza en ti mismo.</p><h4>3. <strong>Desarrolla Habilidades Nuevas</strong></h4><p>Aprender nuevas habilidades o mejorar las existentes puede aumentar tu sentido de competencia y autoeficacia. Participa en actividades que te interesen y desafíen.</p><h4>4. <strong>Rodeate de Personas Positivas</strong></h4><p>Las relaciones saludables y de apoyo pueden tener un gran impacto en tu autoestima. Rodéate de personas que te valoren y te animen a ser tu mejor versión.</p><h4>5. <strong>Cuida de Tu Salud Física</strong></h4><p>El ejercicio regular, una dieta equilibrada y un buen sueño son fundamentales para mantener un equilibrio físico y mental. Cuidar de tu cuerpo también mejora tu percepción de ti mismo.</p><h4>6. <strong>Práctica la Autocompasión</strong></h4><p>Sé amable contigo mismo en momentos de dificultad. La autocompasión implica tratarte con la misma amabilidad y comprensión con la que tratarías a un amigo cercano.</p><h4>7. <strong>Evita Compararte con Otros</strong></h4><p>Cada persona tiene su propio camino y sus propias luchas. Compararte con los demás puede ser dañino. Enfócate en tu propio crecimiento y progreso.</p><h4>8. <strong>Busca Ayuda Profesional</strong></h4><p>Si sientes que tus esfuerzos no son suficientes, considera buscar la ayuda de un terapeuta o consejero. La terapia puede proporcionarte herramientas y perspectivas valiosas para mejorar tu autoestima.</p>', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTif2f12U8L3-akp8KOlxrpioPCcNcaJJ99Hg&s', 13, '2024-07-17 13:02:13'),
(12, 'Prueba Post2', 'Ira', '<p style=\"text-align: right; \"><font color=\"#424242\">La adolescencia es una etapa de grandes cambios y desafíos. Durante este período, los jóvenes experimentan transformaciones físicas, emocionales y sociales que pueden ser abrumadoras. La depresión en la adolescencia es un problema serio que afecta a un número significativo de jóvenes y puede tener consecuencias duraderas si no se trata adecuadamente. En este post, exploraremos las causas, síntomas y formas de ayudar a los adolescentes que enfrentan la depresión.</font></p><h2><u>Causas de la Depresión en la Adolescencia</u></h2><p>La depresión en los adolescentes puede ser causada por una combinación de factores, incluyendo:</p><ol><li><span style=\"background-color: rgb(255, 255, 0);\"><strong>Factores Genéticos</strong>:</span> Los antecedentes familiares de depresión pueden aumentar el riesgo de desarrollar la enfermedad.</li><li><span style=\"background-color: rgb(255, 255, 0);\"><strong>Cambios Hormonales</strong>:</span> Los cambios hormonales durante la pubertad pueden contribuir a la aparición de la depresión.</li><li><strong>Estrés Académico</strong>: Las presiones escolares, como el rendimiento académico y las expectativas futuras, pueden ser estresantes.</li><li><strong>Problemas Sociales</strong>: La dificultad para encajar en grupos sociales, el acoso escolar (bullying) y las relaciones interpersonales complicadas pueden desencadenar la depresión.</li><li><strong>Problemas Familiares</strong>: Los conflictos familiares, el divorcio de los padres o la falta de apoyo emocional en el hogar pueden ser factores importantes.</li><li><strong>Traumas</strong>: Experiencias traumáticas, como el abuso físico o emocional, pueden ser un desencadenante significativo.</li></ol>', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTif2f12U8L3-akp8KOlxrpioPCcNcaJJ99Hg&s', 13, '2024-07-17 13:08:14'),
